@Metadata.allowExtensions: true
@AccessControl.authorizationCheck: #NOT_REQUIRED
@EndUserText.label: 'Expense Doc. Type'
define root view entity ZETR_DDL_I_VORGANG
  as select from    zetr_t_exp118                                                    as Main
    left outer join DDCDS_CUSTOMER_DOMAIN_VALUE_T( p_domain_name: 'ZETR_D_VORGANG' ) as Process on  Process.language  = $session.system_language
                                                                                                and Process.value_low = Main.vorgang


  //  association [1..1] to I_GLAccountType as GlAccountType on GlAccountType.GLAccountType = Main.blart
  association [1..1] to I_AccountingDocumentTypeText as AccountingDocumentType on  AccountingDocumentType.AccountingDocumentType = Main.blart
                                                                               and AccountingDocumentType.Language               = $session.system_language

{
      @ObjectModel.text.element: ['VorgangText']
  key Main.vorgang                                      as Vorgang,
      @Consumption.valueHelpDefinition: [ { entity: { name: 'ZETR_DDL_I_ACC_DOC_TYPE_VH', element: 'AccountingDocumentType' }}]
      @ObjectModel.text.element: ['AccountingDocumentTypeName']
  key Main.blart                                        as Blart,
      AccountingDocumentType.AccountingDocumentTypeName as AccountingDocumentTypeName,
      //      GlAccountType.DomainValue as GLAccountTypeName,
      Process.text                                      as VorgangText
}
